description:
Pleno Excel é um façade para o DocumentFormat.OpenXML muito simples de utilizar. 

[TestClass] 
public class MPSC.PlenoSoft.Office.PlenoExcel.Testes
{ 
	[TestMethod] 
	public void Exemplo_De_Como_Gerar_Uma_Planilha_Excel() 
	{
		var arquivoExcel = new FileInfo(@"D:\Temp\PlenoExcel.xlsx"); 
		var plenoExcel = new PlenoExcel(arquivoExcel, Modo.Padrao); 

		var plan1 = plenoExcel["Plan1"]; 

		plan1.Escrever("A", 1, "Numero 1", Style.Header); 
		plan1.Escrever("B", 1, "Número 2", Style.Header); 
		plan1.Escrever("C", 1, "Soma", Style.Header); 

		plan1.Escrever("A", 2, 6, Style.Geral); 
		plan1.Escrever("B", 2, 4, Style.Geral); 
		plan1.Escrever("C", 2, "=SUM(A2:B2)", Style.Geral); 

		plenoExcel.Salvar(); 
		plenoExcel.Fechar(); 
	} 
}

基于键值对形式的二进制数据包生成解析工具, 方便在网络上传输数据.
Binary packet generation tool based on key-value pair form, designed for transmission of data over network.

Read write sample:
byte[] pkt = new PacketWriter().Push("one", "hello").GetBytes();
string str = new PacketReader(pkt).Pull<string>("one");

Dynamic sample:
var som = (dynamic)new PacketWriter();
som.list.value = 1234;
var res = (dynamic)new PacketReader((byte[])som.GetBytes());
int val = (int)res.list.value;

Source code:
https://github.com/afxres/data-packet

